import logo from './logo.svg';
import './App.css';
import { useState, useEffect } from 'react';



function App() {

  const [country, setCountry] = useState([])

  async function getData() {
    const res = fetch('https://restcountries.com/v3.1/all')
    const data = res.json()
    setCountry(data)
  }
  useEffect(() => {
    getData()

  }, [])

  return (
    <div className="App">
      <p>{getData(setCountry)} </p>
    </div>
  );
}

export default App;
